import "./MainLayout.scss";

const { Sider } = Layout;

const MainLayout = (props) => {
  const { children } = props;

  return (
    <Layout className="mainLayout">
      <Sider>Sider</Sider>
      {children}
    </Layout>
  );
};

export default MainLayout;
